To find out how many companies were founded by the founder of Facebook, we can use the following SPARQL query:

```
SELECT (COUNT(?company) AS ?count)
WHERE {
  ?founder a dbo:Person ;
           foaf:name "Mark Zuckerberg" .

  ?company dbo:foundedBy ?founder ;
           a dbo:Company .
}
```

This query retrieves the count of companies founded by the person with the name "Mark Zuckerberg" who is the founder of Facebook.

